INSERT INTO `animal` VALUES (8,'Zebra','En guerison',7,7,'e zèbre des plaines est de taille moyenne, plus petit en moyenne que le zèbre de Grévy, mais plus grand que le zèbre de montagne, épais avec des pattes relativement courtes.','zebre-6683bc8d05a04064997793.jpg','2024-07-02 08:38:37',60),(9,'Simba','Trés bien',10,7,'Le lion asiatique, lion d\'Asie1 ou lion persan (Panthera leo persica ou Panthera leo sinhaleyus)2,3 est une sous-espèce de lions. Son habitat naturel s\'étendait autrefois sur tout le sous-continent indien et il était possible de le trouver de la Syrie à l\'Inde orientale. À cause de la chasse et de la destruction de son habitat, il avait pratiquement disparu du continent au xxe siècle.','liondasie-6683bd410e066736711835.jpg','2024-07-02 08:41:00',41),(10,'Bouffe tout','En super forme',8,6,'La longueur moyenne des mâles est comprise entre 4 et 4,5 mètres et ils peuvent atteindre exceptionnellement 5 à 6 mètres et un poids maximal de 500 kg. Les femelles mesurent moins de 3 mètres. L\'Alligator d\'Amérique fait partie des plus grands alligators du monde .\r\n\r\nIl a été mesuré en laboratoire que l\'alligator américain peut exercer entre ses mâchoires une force atteignant 9 452 N, soit le poids d\'une masse de 964 kg. Cette force dans la mâchoire fut considérée longtemps comme étant supérieure à celle que pouvait exercer n\'importe quelle espèce actuellement vivante. Toutefois, le record fut finalement battu par un spécimen de crocodile marin, calculée à 16 414 N (l\'équivalent d\'une masse de 1 674 kg)3.','aligatore-6683bd775f03f767399678.jpg','2024-07-02 08:42:31',106),(11,'Ramphastos','En super forme',11,5,'Les Toucans toco ont un plumage remarquable avec un corps noir, une gorge blanche, une tache orange et des cercles bleus autour des yeux. Mais ce qui frappe le plus est leur immense bec jaune avec une tache noire. Ce bec paraît pesant, mais est en fait extrêmement léger car il est creux à l\'intérieur. La taille moyenne de ces oiseaux est de 64 centimètres, auxquels il faut ajouter quelque 20 cm pour la longueur du bec.','toco-toucan-6683bf7918006209301844.jpg','2024-07-02 08:51:05',21),(12,'black','Trés malade',12,5,'La panthère noire, appelée aussi léopard noir, est un léopard (Panthera pardus) atteint de mélanisme1, qui est une mutation génétique lui conférant une robe globalement noire. Fréquent chez le léopard dans les forêts tropicales humides de l\'Asie du Sud-Est et de l\'Inde2 (11 % des léopards sont noirs) mais très rare en Afrique3,4, ce phénotype se retrouve aussi parfois en Amérique chez le jaguar (P. onca)5.','black-panther-india-6683bfe18010f163803229.jpg','2024-07-02 08:52:49',15),(13,'Mimille','Bien',13,5,'Archispirostreptus gigas est une espèce d\'arthropodes de la classe des diplopodes (mille-pattes). Surnommé le iule géant africain, c\'est le plus long des diplopodes : les plus grands individus répertoriés mesurent 38,5 cm de long pour 2,1 cm de diamètre. Il a 256 pattes1.\r\n\r\nIl est largement répandu dans l\'est de l\'Afrique, du Mozambique au Kenya, rarement au-dessus de 1 000 mètres2, principalement en forêt, mais aussi dans les zones côtières, si elles possèdent au moins quelques arbres2.\r\n\r\nArchispirostreptus gigas est de couleur noire. Détritivore, il est parfois gardé comme animal de compagnie. En général, les mille-pattes géants ont une espérance de vie de 7 à 10 ans3.','archispirostreptus-gigas-2009-g1-6683c04c6263c005192593.jpg','2024-07-02 08:54:36',11),(14,'Grenouillette','Trés malade',14,5,'Découverte en 2009, cette grenouille habite les hautes forêts andines de l’Équateur. Elle est remarquable pour la vitesse à laquelle elle est capable de lisser sa peau initialement rugueuse et recouverte de protubérances : en quelques minutes à peine ! Les femelles, un peu plus grosses que les mâles, ne mesurent pas plus de 23 mm de long. Autant dire qu’il faut avoir l’œil pour repérer cette petite grenouille verte dans la densité de la forêt.','grenouillette-6683c0d2c719c680011429.jpg','2024-07-02 08:56:50',35),(15,'JO','En super forme',15,5,'Le Gorille de l\'Ouest peut mesurer jusqu\'à 1,7 mètre pour le mâle et 1,3 mètre pour la femelle. Il peut peser jusqu\'à 180 kg pour les mâles et 70 kg pour les femelles. Les mâles peuvent atteindre les 230 kilos en captivité dès lors qu\'ils sont moins actifs que dans la nature tout en étant mieux nourris.','gorilla-gorilla11-6683c16a3aa0e175884094.jpg','2024-07-02 08:59:22',82),(16,'edvige','En guerison',16,6,'Cette chouette à la tête pâle en forme de cœur et aux grands yeux noirs ne peut être confondue avec aucune de ses cousines. Elle doit son nom à son cri, rauque et strident (mais moins terrifiant toutefois que celui du grand-duc !).\r\n\r\nLa chouette effraie mesure 33 à 39 cm et affiche une envergure de 80 à 95 cm, ce qui en fait l’une des plus grandes de France. Son régime alimentaire se compose principalement de micro-mammifères, qu’elle chasse au crépuscule et à l’aube, voire de jour en hiver.\r\n\r\nL’effraie des clochers, comme son nom le laisse supposer, aime nicher dans les bâtiments abandonnés ou les granges, même si on la trouve aussi dans les trous d’arbres. Elle y pond quatre à sept œufs qui éclosent au bout de 30 jours environ. Il faudra au moins 50 jours supplémentaires pour que les jeunes prennent leur envol.','edvige-6683c247515e9852628961.jpg','2024-07-02 09:03:03',70),(17,'Gondin','En super forme',17,6,'Le ragondin est un gros rongeur à l’apparence similaire au rat musqué, reconnaissable à ses quatre grandes incisives oranges. Il pèse en moyenne 7kg et son pelage est brun, son corps est terminé par un longue queue similaire à celle du rat.\r\n\r\nMammifère semi-aquatique, le ragondin mène une vie plutôt crépusculaire ou nocturne mais peut tout de même avoir une activité diurne soutenue. Il aime l’eau douce et creuse des terriers de 6 à 7 mètres le long des berges des fleuves, canaux ou marais. Dans certaines régions à très forte densité de ragondins, et lorsqu’il a à sa disposition un vaste réseau de fossés et canaux, les terriers du ragondin participent à la déstabilisation des berges.\r\nLes ragondins atteignent leur maturité sexuelle vers six mois et la femelle a deux ou trois portées par an de cinq ou sept petits en moyenne.','gondin-6683c2bd258d6257568809.jpg','2024-07-02 09:05:01',65),(18,'Rose','En super forme',18,6,'Le flamant rose (Phoenicopterus roseus), aussi appelé grand flamant rose, est un grand échassier que l’on trouve dans les étendues d’eau salée et dans les terres dans certaines régions d’Eurasie et d’Afrique. Omnivore, il se nourrit principalement de petits animaux et de plantes aquatiques.','rose-6683c341f384c885885495.jpg','2024-07-02 09:07:13',90),(19,'Marou','Bien',19,6,'Le marabout d’Afrique (Leptoptilos crumenifer), parfois simplement appelé marabout, est un oiseau de la famille des Ciconiidés. On le trouve principalement dans les savanes tropicales et les marécages dans plusieurs régions africaines. Carnivore, il se nourrit principalement de carcasses mais mange aussi des petits animaux.','marou-6683c415bade3660327348.jpg','2024-07-02 09:10:45',62),(20,'sophie','En super forme',20,7,'La girafe est le plus grand des animaux terrestres. Les femelles sont en général plus petites de 0,7 à 1 mètre que les mâles.\r\nLes taches de la robe de la girafe sont sa carte d’identité. Dès la naissance, elles sont présentes en modèle réduit. La forme restera mais les taches vont grandir ainsi que les espaces entre elles. La couleur de la robe fonce avec l’âge.\r\nLes deux sexes portent des cornes mais elles sont plus développées et plus épaisses chez le mâle où elles sont en général parallèles ou avec un léger angle vers l’extérieur.\r\nLa girafe est le seul mammifère qui nait avec ses cornes, à l’état de cartilage. Elles sont déjà présentes chez l’embryon, puis elles s’ossifient avec l’âge et se soudent au crâne vers 4 ans chez le mâle et vers 7 ans chez la femelle. Elles ne posent pas de problème lors de la mise bas car elles sont dissociées du crâne et se mettent à plat.\r\nElles se redressent quelques jours après la naissance.','sophie-6683c49a7b6e8851352358.jpg','2024-07-02 09:12:58',60),(21,'babare','En super forme',21,7,'L\'éléphant de savane est l\'une des deux espèces d\'éléphants que l\'on peut trouver en Afrique, avec son cousin, l\'éléphant de forêt. Les deux espèces étaient autrefois considérées comme deux variétés d\'une même espèce, l\'éléphant d\'Afrique, jusqu\'à ce que l\'on découvre qu\'il s\'agit en fait apparemment d\'espèces proches, mais distinctes.\r\n\r\nL\'éléphant de savane est le mieux connu des éléphants ; c\'est le plus gros, et le plus lourd, de tous les mammifères terrestres, et même de tous les animaux terrestres : les grands mâles peuvent mesurer 4 mètres de haut et peser jusqu\'à 6 tonnes : seuls certains animaux marins, comme le rorqual bleu, sont encore plus grands.\r\nL\'éléphant de savane vit, comme son nom l\'indique... dans la savane africaine. C\'est un très gros herbivore, qui doit manger de grandes quantités de feuilles et de fruits, qu\'ils cueillent dans les arbres et les buissons. Ils se déplacent beaucoup, pour trouver de la nourriture.\r\nLes éléphants vivent en troupeaux, constitués des femelles et leurs petits, et guidés par la femelle la plus âgée, la matriarche. Les mâles, eux, vivent seuls. L\'éléphant adulte est tellement grand qu\'il n\'a pas de prédateurs, à part l\'homme, qui le chasse (illégalement, car cela est maintenant interdit) pour l\'ivoire de ses défenses.','babare-6683c514529e8492782539.jpg','2024-07-02 09:15:00',31),(22,'Shenzi','Trés bien',22,7,'L\'histoire des hyènes est bien documentée par l\'existence de nombreux fossiles. Elles partagent un ancêtre commun avec les mangoustes et les civettes et genettes ; la divergence entre leurs lignées se serait produite à la fin de l\'oligocène, il y a 29 à 26 millions d\'années. De fait, les ancêtres des hyènes ressemblaient aux civettes, petits mammifères nocturnes de la famille des viverridés, bas sur pattes, très élégants avec leurs airs de chat, leur nez pointu et leur longue queue. C\'est le cas d\'Ictitherium, qui vivait en Grèce il y a 26 millions d\'années, ou de Plioviverrops, qui occupait l\'Eurasie il y a 20 à 22 millions d\'années. Son rire « sardonique », son goût pour les charognes, son aspect peu engageant ont valu à l\'hyène le mépris des humains. Seul mammifère capable de se nourrir en croquant des os, l\'hyène tachetée est pourtant un précieux éboueur. C\'est aussi un grand chasseur et un animal original par son organisation sociale, où dominent les femelles.','shenzi-6683c5a223bd9969338261.jpg','2024-07-02 09:17:22',12);
