INSERT INTO `habitat` VALUES (5,'La jungle','Les jungles sont situées le long de l\'équateur. La plus grande se trouve en Amérique du Sud : l\'Amazonie. Sur ce continent on trouve aussi des étendues moins importantes dans le sud de l\'Amérique centrale, sur la côte pacifique de la Colombie, dans les Antilles, ainsi que le long de la côte Atlantique du Brésil (forêt atlantique). En Afrique le plus grand ensemble est le bassin du Congo qui occupe l\'Afrique centrale, on en trouve aussi sur la côte guinéenne d\'Afrique de l\'Ouest, et plus ponctuellement en Afrique de l\'Est sur diverses montagnes et sur le littoral de l\'océan Indien. La forêt tropicale de Madagascar s\'étend sur la côte orientale de l\'île. En Asie on peut distinguer deux grands ensembles hétérogènes : celui de l\'archipel malais (Malaisie y compris la péninsule, Indonésie et Philippines) et celui de l\'Asie du Sud-Est continentale (nord-est de l\'Inde, Népal, Bhoutan, Bangladesh, Birmanie, Thaïlande, Laos, Cambodge, Vietnam et sud de la Chine). En Inde on trouve aussi une faible étendue séparée le long des Ghats occidentaux ainsi qu\'au Sri Lanka. En Océanie, l\'ensemble principal est constitué par la Nouvelle-Guinée et ses îles satellites, mais on trouve aussi des ensembles plus modestes sur la côte nord-est de l\'Australie, sur les îles Salomon, les îles Fidji, la Nouvelle-Calédonie et sur de nombreuses petites îles du Pacifique.','humide','Trés bien','2024-07-02 08:35:19','lajungle-6683bbc762592990902300.jpg'),(6,'Les Marais','La végétation des marais est constituée d\'espèces adaptées au milieu humide. Sa composition varie selon la hauteur de l\'eau, l\'importance des périodes d\'assèchement, et le taux de salinité. Les espèces dominantes sont les poacées (roseaux), typhacées (massettes), les joncacées (joncs), cypéracées (carex), et autres plantes herbacées et aquatiques, et des plantes ligneuses basses. Dans les marais d\'eau saumâtre, on rencontre des espèces halophiles.','attention','En super état','2024-07-02 08:36:11','lesmarais-6683bbfba489f053502466.jpg'),(7,'La Savane','La savane est une formation végétale propre aux régions chaudes à longue saison sèche et dominée par les plantes herbacées de la famille des Poacées (Graminées)1. Elle est plus ou moins parsemée d\'arbres ou d\'arbustes. Selon la densité (dans l\'ordre croissant) des espèces, on parle de « savane herbeuse », de « savane arbustive », de « savane arborée », de « savane boisée », puis de forêt claire, la transition se faisant en général de manière progressive.','il fait chaud','Trés bien','2024-07-02 08:37:00','lasavane-6683bc2c2c935603490184.jpg');
/*!40000 ALTER TABLE `habitat` ENABLE KEYS */;
UNLOCK TABLES;

