INSERT INTO `services` VALUES (4,'Visite En Train (Payante)','La visite du zoo Arcadia en train permet de découvrir les différents habitats de manière confortable et panoramique. Ce trajet pittoresque offre des vues imprenables sur les animaux et leur environnement.','trainvisite-6683baf3d48ba673883931.jpg','2024-07-02 08:31:00'),(5,'Visite Guidée (Gratuit)','La visite guidée au zoo Arcadia offre une immersion enrichissante, où des experts partagent des informations fascinantes sur les animaux et leurs comportements. Les guides fournissent des anecdotes, enrichissant l\'expérience.','visite-guidee-6683bb164a1fa192790196.jpg','2024-07-02 08:32:00'),(6,'Restauration','Le restaurant du zoo Arcadia offre une vue panoramique sur les habitats environnants. Il propose une variété de plats locaux et internationaux, adaptés à tous les âges et préférences alimentaires. Les visiteurs peuvent se détendre et savourer leur repas','resto-serengeti-6683bb3c7c813151930259.jpg','2024-07-02 08:33:00');
